import React, { useState } from 'react';
import QPool from './qpoll';


export const App = () => {

    const [items, setValue] = useState([{
        id: 0,
        question_type: '',
        question_text: '',
        answer: []        
    }]);

    const additem = () => {
        var i = items.length;
        i += 1;
        var newitem = {
            id: i,
            question_type: '',
            question_text: '',
            answer: []
        };
        setValue((prevState) => [...prevState, newitem]);
    };

    return(
        <div className = "mainp">
            <h1>Название</h1>
            <input type = "text" id = "shablon_title"></input>
            <h1>Выберите логотип компании</h1>
            <select id ="logoselect">
                <option value="OKB">OKB</option>
                <option value="QWE">QWE</option>
            </select>

            <QPool image_delete={require('../images/close.png')}></QPool>

            <button id="addtask" >
                <img src={require('../images/plus.png')} alt='add'></img>
                <h1>Добавить вопрос</h1>
            </button>
            <button id="addtask">
                <h1>Сохранить</h1>
            </button>
        </div>
    );

};
